import TripItem from "./TripItem";
import axios from "axios";
import { useState, useEffect } from "react";

function TripsList() {
  const [trips, setTrips] = useState(null);
  useEffect(() => {
    axios.get("/api/v1/trips").then((res) => {
      const trips = res;
      setTrips(trips);
      console.log(trips);
    });
  }, []);

  return (
    <h1>
      <TripItem />
    </h1>
  );
}

export default TripsList;
